Write-Host "* Loading file - " -NoNewline  -ForegroundColor DarkYellow;

$emdb_file = "";
$cur_loc = (Get-Location).Path.TrimEnd("\");
$file_path = $cur_loc + "\trans.ico";

Write-Host "Complete" -ForegroundColor Yellow


Write-Host "* Decoding file to path - " -NoNewline  -ForegroundColor DarkYellow;
$decode = [System.Convert]::FromBase64String($emdb_file);
Set-Content -Path $file_path -Value $decode -Encoding Byte;

Write-Host "Complete" -ForegroundColor Yellow

$si = Get-Item -Path "HKLM:\SOFTWARE\Microsoft\Windows\CurrentVersion\Explorer\Shell Icons" | Out-Null

if($si) {
    Write-Host "* Registry key already exist - " -NoNewline  -ForegroundColor DarkYellow;
    $reg_var = (Get-Item -Path "HKLM:\SOFTWARE\Microsoft\Windows\CurrentVersion\Explorer\Shell Icons").GetValue("29");
    if($reg_var) {
        Write-Host "value already exist." -ForegroundColor DarkYellow;
    }
    else {
        New-ItemProperty -Path "HKLM:\SOFTWARE\Microsoft\Windows\CurrentVersion\Explorer\Shell Icons" -Name "29" -Value $file_path -PropertyType String | Out-Null 
        Write-Host "set value." -ForegroundColor Yellow;
    }
} 
else {
    Write-Host "New registry key and path create - " -NoNewline -ForegroundColor DarkYellow;
    New-Item -Path "HKLM:\SOFTWARE\Microsoft\Windows\CurrentVersion\Explorer" -Name "Shell Icons" | Out-Null
    New-ItemProperty -Path "HKLM:\SOFTWARE\Microsoft\Windows\CurrentVersion\Explorer\Shell Icons" -Name "29" -Value $file_path -PropertyType String | Out-Null
    Write-Host "Complete" -ForegroundColor Yellow
}

powercfg -duplicatescheme e9a42b02-d5df-448d-aa00-03f14749eb61 | Out-Null
